import React from "react";
import { Link } from "react-router-dom";
import './card.css'

export default function Card(props){
    return (
        <div className="card">
            <img src={props.cover} alt='housing'></img>
            <p>{props.title}</p>
            <p>{props.description}</p>
        </div>
    )
}
